import React, { Component } from "react";

class TableData extends Component {
  render() {
    console.log("TCL: TableData -> render -> data", this.props.DataUser);
    ShowPermission = () => {
      if (this.props.DataUser.permission === 0) {
        return "Manager";
      } else if (this.props.DataUser.permission=== 1) {
        return "Emloyee";
      } else return "Client";
    };
    var items = this.props.DataUser.map((item, index) => {
      return (
        <tr key={index}>
          <td>{index}</td>
          <td>{item.name}</td>
          <td>{item.phone}</td>
          <td>{this.ShowPermission()}</td>
          <td className="Acction">
            <button className="ui red button">Delect</button>
            <button className="ui blue button">Edit</button>
          </td>
        </tr>
      );
    });

    return (
      <div>
        <table className="ui celled table">
          <thead>
            <tr>
              <th>STT</th>
              <th>Name</th>
              <th>Phone</th>
              <th>Right</th>
              <th>Acction</th>
            </tr>
          </thead>
          {items}
          <tbody />
        </table>
      </div>
    );
  }
}

export default TableData;
